import React, { useEffect, useState } from "react";
import axios from 'axios';
import Swal from "sweetalert2";


import { Button, Card, CardBody, CardTitle, CardSubtitle, CardText, CardGroup, CardImg, CardColumns, CardHeader, Col } from 'reactstrap';


function Upimg() {

    const [data, setData] = useState([0])

    useEffect(() => {
        axios.get('http://localhost:3000/api/product/view')
            .then(res => {
                console.log(res.data)
                setData(res.data)
            })
            .catch(err => {
                console.log(err)
            })
    }, [])


    const postDelete = (id, e) => {
        e.preventDefault();
        axios.delete(`http://localhost:3000/api/img/eliminar?id=${id}`)
            .then(res => console.log(res))
            .catch(err => console.log(err))
        Swal.fire({
            title: 'Eliminando...',
            text: 'Usuario de Id: ' + id + ' Eliminado',
            icon: 'warning',
            confirmButtonText: 'Ok'
        })
    }

    return (
        <div className="container">
            <div className="row ">
                <div className="col">
                    {
                        data.map((data) => (
                            <div class="card text-white bg-primary mb-3" style="max-width: 18rem;">
                                <div class="card-header">Header</div>
                                <div class="card-body">
                                    <h5 class="card-title">{data.title}</h5>
                                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                </div>
                            </div>
                        ))
                    }
                </div>
            </div>
        </div>

    )



}

export default Upimg;
